import React from 'react';
import s from './Achievemtns.module.css';

const AchievemtnsCart = (props) => {

    return (
        <div className={s.cart}>
            <img id={s.achieventn_img2} src={props.imgSrc} alt='' />
            <span id={s.achievemt_header}>{props.achievementHeader}</span>
            <span id={s.achievemt_description}>{props.achievementDescription}</span>
            <div className={s.buttons}>
                <button>{props.buttonText}</button>
            </div>
        </div>
    );
}

export default AchievemtnsCart;
